import React, { Component } from 'react';
import PropTypes from 'prop-types';

class Button extends Component {
  render() {
    const { text } = this.props;
    return (
      <button type="submit">
        { text }

      </button>
    );
  }
}

export default Button;

Button.propTypes = {
  text: PropTypes.string.isRequired,
};
